var states = ['black', 'uv', 'black', 'original'];
var stateCounter = 0;

function flash() {

	if (states[stateCounter] == 'original') {
		document.getElementsByClassName('date')[0].style.visibility = 'visible';
	} else if (states[stateCounter] == 'uv') {
		document.getElementsByClassName('confirm')[0].style.visibility = 'visible';
    document.getElementsByClassName('uv')[0].style.color = '#92f536';
    document.getElementsByClassName('uv')[1].style.color = '#92f536';
	} else {
		document.getElementsByClassName('date')[0].style.visibility = 'hidden';
		document.getElementsByClassName('confirm')[0].style.visibility = 'hidden';
    document.getElementsByClassName('uv')[0].style.color = '#ffffff';
    document.getElementsByClassName('uv')[1].style.color = '#ffffff';
	}

	  if (states[stateCounter] == 'uv') {
	    document.getElementsByClassName('image-container')[0].style.background =
        'url(data:image/jpg;base64,';
    } else {
      document.getElementsByClassName("image-container")[0].style.backgroundImage =
        "url('assets/images/" + states[stateCounter] + ".jpg')";
    }

    stateCounter++;
    if (stateCounter >= states.length) {
        stateCounter = 0;
    }
}